import { React, useEffect } from 'react';
import { Routes, Route, useNavigate } from 'react-router-dom';


const Landing = () => {
    const navigate = useNavigate();

    useEffect(() => {
        const token = localStorage.getItem('token');
        if (token) {
            navigate('/landing-page');
        } else {
            navigate('/login');
        }
    }, [navigate]);

    return <>Hi</>;
}
